import React from 'react'

const proxyUrl = "https://cors-anywhere.herokuapp.com/";
const url = "https://us-central1-project-share-8df06.cloudfunctions.net/api/";

const Fetching = () => {
    const component = () => {
        // Get Requests
        fetch(proxyUrl + url + 'getHome')
            .then(res => res.json())
            .then(data => console.log(data))
            .catch(() => console.log("Couldn't connect to " + url + " request. Check your browser"));
        
        // Post Requests and Headers
        fetch(proxyUrl + url + 'createPost', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': 'Bearer eyJhbGciOiJSUzI1NiIsImtpZCI6IjFlNjYzOGY4NDlkODVhNWVkMGQ1M2NkNDI1MzE0Y2Q1MGYwYjY1YWUiLCJ0eXAiOiJKV1QifQ..gsnp7hKUfKiMAEoM5Qr7JRLUYYTzQ-LsteltGeKWZu3ECdJiwWzIkw5VegxHlnqooaOLICWMGidZs9um7gFJQRg1vVFYaKMwSooCA4xML4ExxxHjZm_pWpB6v1iBIUdJ1zHWOD5eCE3ofct1oMOm7iiRFLC6FzSInUwPkLaLnoOIatpbO6XX9R6ZXuJ9ulOSEf3QRNH6XKJLkfWGmh_I7KFJ4lV3BrKw9nqEBuSdDrBt2LyhZAaJT2j0daTK29ciF5IZZ1zMrGcAu-6USsgnKj8Qw8uLpPLxGhK8BrT3gGhTrHxo7vrHeQ_z6V0FcsQrfGcUODwmYOWrTySDe2Jc7w'
            },
            body: JSON.stringify({
                "title": "om's Title",
                "body": "This is fetch's body",
                "category": "Brown Bois"
            }) // body data type must match "Content-Type" header
        })
        .then(res => res.json())
        .then(data => {
            console.log(data);
        })
        .catch(err => {
            console.error(err);
        })
    }

    return (
        <div>
            { component() }
        </div>
    )
}

export default Fetching;
